INSERT INTO `trips` VALUES (1,'saqrwlqfgt6tswlc5qy1km14','Юг','2025-01-22 23:35:21.354000','2025-02-17 23:30:11.680000',NULL,1,1,NULL,'Отправьтесь в увлекательное путешествие по югу Ольхона! Вы посетите мыс Хужирский с его захватывающими видами, увидите скалистые берега мыса Елгай и побываете у Ступы Просветления на острове Огой — священного места буддистов. Далее вас ждёт мистический мыс Дракон (Хвост дракона), уникальная скала Кобылья голова, а завершится маршрут у кристально чистого Нурского озера, где будут видны знаменитые пузыри Байкальского льда. Погрузитесь в атмосферу Байкала и откройте для себя его магию!',15.00,'https://yandex.ru/map-widget/v1/?um=constructor%3A3997034ef3853e74194437397fa83541724302433a8329fed15b2450cc4bc8a2&amp;source=constructor',40.00),(3,'u9hhfjdqy68f8vqg0ht53zqc','Север','2025-01-22 23:37:01.371000','2025-02-17 23:30:37.921000',NULL,1,1,NULL,'Откройте для себя мистические и величественные места севера Ольхона! Начнём с легендарной скалы Шаманка, одного из главных символов Байкала. Затем отправимся к живописному Харанцынскому острову, увидим впечатляющую скалу Голова льва и загадочный мыс Будун. По пути нас встретят таинственные утёсы Три брата, а кульминацией путешествия станет мыс Хобой — самая северная точка острова с потрясающими панорамными видами. Вас ждут незабываемые впечатления и энергия великого Байкала!',7.00,'https://yandex.ru/map-widget/v1/?um=constructor%3A556ce4f834a5a1ac8db086aae98e1e70c7a75b37200649f5e5c2e1c921dcd245&amp;source=constructor',40.00),(17,'saqrwlqfgt6tswlc5qy1km14','Юг','2025-01-22 23:35:21.354000','2025-02-17 23:30:11.680000','2025-02-17 23:30:11.690000',1,1,NULL,'Отправьтесь в увлекательное путешествие по югу Ольхона! Вы посетите мыс Хужирский с его захватывающими видами, увидите скалистые берега мыса Елгай и побываете у Ступы Просветления на острове Огой — священного места буддистов. Далее вас ждёт мистический мыс Дракон (Хвост дракона), уникальная скала Кобылья голова, а завершится маршрут у кристально чистого Нурского озера, где будут видны знаменитые пузыри Байкальского льда. Погрузитесь в атмосферу Байкала и откройте для себя его магию!',15.00,'https://yandex.ru/map-widget/v1/?um=constructor%3A3997034ef3853e74194437397fa83541724302433a8329fed15b2450cc4bc8a2&amp;source=constructor',40.00),(18,'u9hhfjdqy68f8vqg0ht53zqc','Север','2025-01-22 23:37:01.371000','2025-02-17 23:30:37.921000','2025-02-17 23:30:37.930000',1,1,NULL,'Откройте для себя мистические и величественные места севера Ольхона! Начнём с легендарной скалы Шаманка, одного из главных символов Байкала. Затем отправимся к живописному Харанцынскому острову, увидим впечатляющую скалу Голова льва и загадочный мыс Будун. По пути нас встретят таинственные утёсы Три брата, а кульминацией путешествия станет мыс Хобой — самая северная точка острова с потрясающими панорамными видами. Вас ждут незабываемые впечатления и энергия великого Байкала!',7.00,'https://yandex.ru/map-widget/v1/?um=constructor%3A556ce4f834a5a1ac8db086aae98e1e70c7a75b37200649f5e5c2e1c921dcd245&amp;source=constructor',40.00);
