INSERT INTO `vehicles` VALUES (1,'x5zk0lwyjxp90d6psi0nklqz','Соболь','2025-01-22 23:50:51.214000','2025-02-18 13:41:22.735000',NULL,1,1,NULL,2700,8,'В салоне предусмотрены комфортные сиденья, столик и аудиосистема, создающие уютную атмосферу в дороге. Отличная проходимость автомобиля позволит вам добраться даже до самых удаленных мест, а комфортный салон сделает поездку приятной и незабываемой.','Зима'),(3,'t2ne6p9u1fi2r260sac4e828','Хивус','2025-01-22 23:56:44.267000','2025-02-18 13:41:45.375000',NULL,1,1,NULL,4000,8,'Быстрый и безопасный транспорт на воздушной подушке, идеально подходящий для путешествий по зимнему Байкалу. Благодаря уникальной конструкции он легко передвигается по льду, воде и заснеженной поверхности, обеспечивая комфорт и безопасность пассажиров. Внутри предусмотрены удобные сиденья и система отопления, создающая уютную атмосферу даже в суровых условиях. Хивус позволяет добраться до самых труднодоступных мест Ольхона, открывая невероятные зимние пейзажи Байкала.',NULL),(5,'jlam7q5vcn5px2q9xkk4quk3','Трэкол','2025-01-22 23:58:52.350000','2025-02-18 13:41:59.333000',NULL,1,1,NULL,4600,10,'Мощный вездеход с высокой проходимостью, незаменимый для поездок по бездорожью. Его широкие шины позволяют легко преодолевать снег, песок, каменистые участки и заболоченные местности. В салоне оборудованы удобные сиденья, а система отопления обеспечивает комфорт даже в холодное время года. Трэкол идеально подходит для путешествий по Ольхону в любое время года, открывая доступ к самым живописным и труднодоступным уголкам Байкала.',NULL),(29,'x5zk0lwyjxp90d6psi0nklqz','Соболь','2025-01-22 23:50:51.214000','2025-02-18 13:41:22.735000','2025-02-18 13:41:22.748000',1,1,NULL,2700,8,'В салоне предусмотрены комфортные сиденья, столик и аудиосистема, создающие уютную атмосферу в дороге. Отличная проходимость автомобиля позволит вам добраться даже до самых удаленных мест, а комфортный салон сделает поездку приятной и незабываемой.','Зима'),(30,'t2ne6p9u1fi2r260sac4e828','Х